import React from 'react'; 
import { Component } from 'react'
const endpoint = 'https://api.giphy.com/v1/gifs/search?api_key=dhopdH0nHNKQWlQ1ttMm2WtYEBvAQY6R&q=dazedandconfused&limit=25&offset=0&rating=G&lang=en'

class MainContainer extends Component {
  constructor(props){
    super(props)
    this.state = {
      gifList: [] 
    };
  };

   componentDidMount() {
    return fetch(endpoint)
     .then(response => response.json())
     .then(gifList => {
       let gifUrls = []
       gifList = gifList.data; 
       for (let i = 0; i < gifList.length; i++) {
         //gifUrls are an array of image tagged
         gifUrls.push("<img " + gifList[i].url + ">")
         console.log(gifUrls)
       }
       this.setState({gifList: gifUrls})
     })
     .catch(error => console.log(error)) 
  }; 







 render(props){
   return ( 
    <div> 
       <p></p>
    </div>
    )
  };
};



export default MainContainer;
